DROP TRIGGER IF EXISTS `before_insert_keluarga`;
DELIMITER ;;
CREATE TRIGGER `before_insert_keluarga` BEFORE INSERT ON `data_keluarga` FOR EACH ROW BEGIN
	VALUES ( NEW.no_pendaftaran, 1) ON DUPLICATE KEY 
	UPDATE  `data_keluarga` = 1;	
    END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `after_delete_keluarga`;
DELIMITER ;;
CREATE TRIGGER `after_delete_keluarga` AFTER DELETE ON `data_keluarga` FOR EACH ROW BEGIN
	DECLARE irow_count INT(11);	
	SET irow_count := (SELECT COUNT(*) FROM data_keluarga WHERE no_pendaftaran = OLD.no_pendaftaran AND nisn= OLD.nisn);  
	IF (irow_count>0) THEN
	   UPDATE `data_step`
	   SET 
	     `data_keluarga` = 1	  
	   WHERE `no_pendaftaran` = OLD.no_pendaftaran;
	ELSE			
	   UPDATE `data_step`
	   SET 
	     `data_keluarga` = 0	  
	   WHERE `no_pendaftaran` = OLD.no_pendaftaran;
	END IF;
    END
;;
DELIMITER ;
