			SELECT no_pendaftaran, 1 FROM data_pendaftaran WHERE nisn = NEW.nisn
		 ON DUPLICATE KEY 
			UPDATE  `data_diri` = 1;	
	ELSE
			SELECT no_pendaftaran, 0 FROM data_pendaftaran WHERE nisn = NEW.nisn
		ON DUPLICATE KEY 
			UPDATE  `data_diri` = 0;
	END IF;
    END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `before_insert_tanah_bangunan`;
DELIMITER ;;
CREATE TRIGGER `before_insert_tanah_bangunan` BEFORE INSERT ON `data_tanah_bangunan` FOR EACH ROW BEGIN
	VALUES ( NEW.no_pendaftaran, 1)
	ON DUPLICATE KEY 
	UPDATE  `data_tanah_bangunan` = 1;
    END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `after_delete_tanah_bangunan`;
DELIMITER ;;
CREATE TRIGGER `after_delete_tanah_bangunan` AFTER DELETE ON `data_tanah_bangunan` FOR EACH ROW BEGIN
	DECLARE irow_count INT(11);	
	SET irow_count := (SELECT COUNT(*) FROM data_tanah_bangunan WHERE no_pendaftaran = OLD.no_pendaftaran AND nisn= OLD.nisn);  
	IF (irow_count>0) THEN
	   UPDATE `data_step`
	   SET 
	     `data_tanah_bangunan` = 1	  
	   WHERE `no_pendaftaran` = OLD.no_pendaftaran;
	ELSE			
	   UPDATE `data_step`
	   SET 
	     `data_tanah_bangunan` = 0	  
	   WHERE `no_pendaftaran` = OLD.no_pendaftaran;
	END IF;
    END
;;
DELIMITER ;
